import React from 'react';
import logo from '../assets/images/logo-no-background.png'; // Ensure this path is correct
import './App.css'; // Assuming you're using App.css for global styles

const Header = () => {
  return (
    <header className="header">
      <img src={logo} alt="Logo" className="logo" />
      {/* Other header content */}
    </header>
  );
};

export default Header;
